-- these are sprites which will need to be accessed by multiple functions
claudius_sprite = nil;
kyle = nil;
captain = nil;

function Load(m)
	-- First, record the current map in the "map" variable that is global to this script
	map = m;
	map.run_forever = true;
	dialogue_supervisor = m.dialogue_supervisor;
	event_supervisor = m.event_supervisor;

	CreateDialogue();

	local sprite;
	local dialogue;
	local event;
	local chest;
	local text;

	if (GlobalManager:DoesEventGroupExist("kyle_story") == false) then
		GlobalManager:AddNewEventGroup("kyle_story");
	end
	if (GlobalManager:DoesEventGroupExist("last_visited") == false) then
		GlobalManager:AddNewEventGroup("last_visited");
		GlobalManager:GetEventGroup("last_visited"):AddNewEvent("map_number", 0);
	end

	-- prepare sprite for the protagonist, Claudius
	claudius_sprite = ConstructSprite("Claudius", 1000, 65, 90);
	claudius_sprite:LoadAttackAnimations("img/sprites/map/claudius_attack.png");

	-- determine which entrance to start at
	if (GlobalManager:GetEventGroup("last_visited"):GetEvent("map_number") == 0) then
		-- just started, position Claudius inside the training hall
		claudius_sprite:SetContext(2);
		claudius_sprite:SetXPosition(60, 0);
		claudius_sprite:SetYPosition(50, 0);
	elseif (GlobalManager:GetEventGroup("last_visited"):GetEvent("map_number") == 1) then
		-- came from south (desert_outskirts)
		claudius_sprite:SetXPosition(66, 0);
		claudius_sprite:SetYPosition(120, 0);
	elseif (GlobalManager:GetEventGroup("last_visited"):GetEvent("map_number") == 2) then
		-- came from east (desert_barracks)
		claudius_sprite:SetXPosition(100, 0);
		claudius_sprite:SetYPosition(83, 0);
	elseif (GlobalManager:GetEventGroup("last_visited"):GetEvent("map_number") == 3) then
		-- came from west (new_cave)
		claudius_sprite:SetXPosition(30, 0);
		claudius_sprite:SetYPosition(83, 0);
	end
	

	kyle = ConstructSprite("Kyle", 2, 66, 50, 0.0, 0.0);
	kyle:SetContext(2);
	kyle:SetNoCollision(true);
	kyle:SetMovementSpeed(hoa_map.MapMode.FAST_SPEED);
	
	-- Add NPC Karlate Captain
	captain = ConstructSprite("Captain", 3, 60, 46, 0.0, 0.0);
	captain:SetContext(2);
	captain:AddDialogueReference(2);
	
	-- Generic Karlate Sprite (training site guard #1)
	sprite = ConstructSprite("Karlate", 4, 52, 78, 0.0, 0.0);
	sprite:AddDialogueReference(3);
	map:AddGroundObject(sprite);

	-- Generic Karlate Sprite (training site guard #2)
	sprite = ConstructSprite("Karlate", 5, 60, 78, 0.0, 0.0);
	sprite:AddDialogueReference(4);
	map:AddGroundObject(sprite);

	-- Generic Karlate Sprite (armorer)
	sprite = ConstructSprite("Karlate", 6, 88, 110, 0.0, 0.0);
	sprite:AddDialogueReference(5);
	map:AddGroundObject(sprite);

	-- Generic Karlate Sprite (inside training hall)
	sprite = ConstructSprite("Karlate", 7, 42, 45, 0.0, 0.0);
	sprite:AddDialogueReference(6);
	sprite:SetContext(2);
	map:AddGroundObject(sprite);

	-- Create a zone for exiting the map, to be used as a trigger
	exit_zone = hoa_map.MapZone();
	exit_zone:AddSection(hoa_map.ZoneSection(18, 122, 113, 127)); -- south exit
	map:AddZone(exit_zone);

	exit_zone2 = hoa_map.MapZone();
	exit_zone2:AddSection(hoa_map.ZoneSection(0, 80, 17, 85)); -- west exit
	map:AddZone(exit_zone2);

	exit_zone3 = hoa_map.MapZone();
	exit_zone3:AddSection(hoa_map.ZoneSection(114, 0, 128, 127)); -- east exit
	map:AddZone(exit_zone3);

	-- Create zones for switching the map context
	context_zone = hoa_map.ContextZone(1, 2);
	context_zone:AddSection(hoa_map.ZoneSection(64, 62, 67, 63), false);
	context_zone:AddSection(hoa_map.ZoneSection(64, 64, 67, 65), true);
	map:AddZone(context_zone);

	-- Register event functions
	event = hoa_map.ScriptedEvent(3, 3, 0);
	event_supervisor:RegisterEvent(event);
	event = hoa_map.ScriptedEvent(4, 4, 0);
	event_supervisor:RegisterEvent(event);
	event = hoa_map.ScriptedEvent(5, 5, 0);
	event_supervisor:RegisterEvent(event);
	event = hoa_map.ScriptedEvent(6, 6, 0);
	event_supervisor:RegisterEvent(event);

	event = hoa_map.DialogueEvent(10000, 1); -- triggers initial dialogue with captain
	event_supervisor:RegisterEvent(event);
	event = hoa_map.PathMoveSpriteEvent(10001, kyle, 66, 124);
	event_supervisor:RegisterEvent(event);
	event = hoa_map.AnimateSpriteEvent(10002, claudius_sprite); -- Claudius takes practice swing
	event:AddFrame(12, 850);
	event_supervisor:RegisterEvent(event);
	event = hoa_map.PathMoveSpriteEvent(10003, captain, 66, 50);
	event_supervisor:RegisterEvent(event);

	event = hoa_map.DialogueEvent(11000, 7); -- triggers transitionary dialogue
	event_supervisor:RegisterEvent(event);

	event = hoa_map.MapTransitionEvent(22111, "dat/maps/desert_outskirts.lua");
	event_supervisor:RegisterEvent(event);
	event = hoa_map.MapTransitionEvent(22112, "dat/maps/new_cave.lua");
	event_supervisor:RegisterEvent(event);
	event = hoa_map.MapTransitionEvent(22113, "dat/maps/desert_barracks.lua");
	event_supervisor:RegisterEvent(event);


	if (GlobalManager:GetEventGroup("kyle_story"):DoesEventExist("kyle_leaves") == false) then
		-- executes if this is the first time in this map
		map:AddGroundObject(captain);
		map:AddGroundObject(kyle);
		event_supervisor:StartEvent(10000);
	elseif (GlobalManager:GetEventGroup("kyle_story"):DoesEventExist("betrayal") == true) then
		-- do we need to do anything here?  just do not let it fall through to the next one
	elseif (GlobalManager:GetEventGroup("kyle_story"):DoesEventExist("desert_beast_fought") == true) then
		-- executes if we just fought the beast in the desert
		kyle:SetXPosition(60, 0);
		kyle:SetYPosition(120, 0);
		kyle:SetContext(1);

		map:AddGroundObject(kyle);
		event_supervisor:StartEvent(11000);
	end

	GlobalManager:GetEventGroup("last_visited"):SetEvent("map_number", 0);

	map:AddGroundObject(claudius_sprite);    -- add Claudius to map
	map:SetCamera(claudius_sprite);          -- Set the camera to focus on the player sprite
end -- function Load()


function Draw()
	map:DrawMapLayers();
end


function Update()
	-- Check if the map camera is in the exit zone
	if (exit_zone:IsInsideZone(map.camera.x_position, map.camera.y_position) == true) then
		if (event_supervisor:IsEventActive(22111) == false) then
			event_supervisor:StartEvent(22111);
		end
	elseif (exit_zone2:IsInsideZone(map.camera.x_position, map.camera.y_position) == true) then
		if (event_supervisor:IsEventActive(22112) == false) then
			event_supervisor:StartEvent(22112);
		end
	elseif (exit_zone3:IsInsideZone(map.camera.x_position, map.camera.y_position) == true) then
		if (event_supervisor:IsEventActive(22113) == false) then
			event_supervisor:StartEvent(22113);
		end
	end
end

function CreateDialogue()
	local dialogue;
	
	dialogue = hoa_map.MapDialogue(1);
	text = hoa_system.Translate("You're late.");
	dialogue:AddText(text, 3, 1, 0, false);
	text = hoa_system.Translate("Sorry, sir, I ");
	dialogue:AddText(text, 1000, 2, 0, false);
	text = hoa_system.Translate("Its my fault, sir. I dragged Claudius off this morning.");
	dialogue:AddText(text, 2, 3, 0, false);	
	text = hoa_system.Translate("Very well. Kyle. Find a partner to train with. Ill deal with you later.");
	dialogue:AddText(text, 3, 4, 0, false);
	text = hoa_system.Translate("All right buddy, let's go.");
	dialogue:AddText(text, 2, 5, 0, false);
	text = hoa_system.Translate("Not him. Claudius trains with me today.");
	dialogue:AddText(text, 3, 6, 0, false);
	text = hoa_system.Translate("Yes sir.");
	dialogue:AddText(text, 2, 7, 3, false);
	text = hoa_system.Translate("Show me your slicing attack technique.");
	dialogue:AddText(text, 3, 8, 10002, false);
	text = hoa_system.Translate("Hi-ya!");
	dialogue:AddText(text, 1000, 9, 0, false);
	text = hoa_system.Translate("Good. Remember, never take your eye off your target. Now show me the proper form for a parry.");
	dialogue:AddText(text, 3, 10, 10002, false);
	text = hoa_system.Translate("Nicely done.");
	dialogue:AddText(text, 3, 11, 0, false);
	text = hoa_system.Translate("Thank you, sir.");
	dialogue:AddText(text, 1000, 12, 0, false);
	text = hoa_system.Translate("Lets see how you fare when the opponent strikes back. Kyle! Get over here!");
	dialogue:AddText(text, 3, 13, 0, false);
	text = hoa_system.Translate("Wheres that friend of yours run off to this time?");
	dialogue:AddText(text, 3, 14, 0, false);
	text = hoa_system.Translate("I dont know, sir.");
	dialogue:AddText(text, 1000, 15, 0, false);
	text = hoa_system.Translate("Youll face me then.");
	dialogue:AddText(text, 3, 16, 5, false);
	text = hoa_system.Translate("Sir?");
	dialogue:AddText(text, 1000, 17, 0, false);
	text = hoa_system.Translate("Draw your weapon.");
	dialogue:AddText(text, 3, 18, 0, false);
	text = hoa_system.Translate("Remember what youve learned.");
	dialogue:AddText(text, 3, 19, 10002, false);
	text = hoa_system.Translate("Well done, Claudius.");
	dialogue:AddText(text, 3, 20, 0, false);
	text = hoa_system.Translate("Yes, sir.");
	dialogue:AddText(text, 1000, 21, 0, false);
	text = hoa_system.Translate("Come with me, Claudius, we need to talk.");
	dialogue:AddText(text, 3, 22, 0, false);
	text = hoa_system.Translate("Yes?");
	dialogue:AddText(text, 1000, 23, 0, false);
	text = hoa_system.Translate("You and Kyle are close.");
	dialogue:AddText(text, 3, 24, 0, false);
	text = hoa_system.Translate("We are, sir.");
	dialogue:AddText(text, 1000, 25, 0, false);
	text = hoa_system.Translate("You have a lot of potential, Claudius. I know Kyle is your friend, but I fear hes becoming an impediment to your quest for knighthood.");
	dialogue:AddText(text, 3, 26, 0, false);
	text = hoa_system.Translate("Kyle is a good man, sir.");
	dialogue:AddText(text, 1000, 27, 0, false);
	text = hoa_system.Translate("Regardless, I want you to consider your priorities. Becoming a knight takes sacrifice. Sometimes that sacrifice means spending less time with the people we care about.");
	dialogue:AddText(text, 3, 28, 0, false);
	text = hoa_system.Translate("I understand, sir.");
	dialogue:AddText(text, 1000, 29, 0, false);
	text = hoa_system.Translate("Just think about it. Now, do me a favor and find Kyle. I need to speak with him as well.");
	dialogue:AddText(text, 3, -1, 6, false);
	dialogue_supervisor:AddDialogue(dialogue);

	dialogue = hoa_map.MapDialogue(2);
	text = hoa_system.Translate("I need you to look for Kyle.  I hope he didn't wander off.  Maybe the other soldiers know where he is?");
	dialogue:AddText(text, 3, -1, 0, false);
	dialogue_supervisor:AddDialogue(dialogue);

	dialogue = hoa_map.MapDialogue(3);
	text = hoa_system.Translate("This is the Karlate training site.  The barracks are to the east.  There's a cave off to the west.");
	dialogue:AddText(text, 4, -1, 0, false);
	dialogue_supervisor:AddDialogue(dialogue);

	if (GlobalManager:GetEventGroup("kyle_story"):DoesEventExist("betrayal") == true) then
		-- change some dialogue if betrayal has occurred
		dialogue = hoa_map.MapDialogue(4);
		text = hoa_system.Translate("The captain and some others went off to the cave down that path to the west.");
		dialogue:AddText(text, 5, -1, 0, false);
		dialogue_supervisor:AddDialogue(dialogue);
	else
		dialogue = hoa_map.MapDialogue(4);
		text = hoa_system.Translate("Kyle?  Oh, yeah, I think he went off to the south.");
		dialogue:AddText(text, 5, -1, 0, false);
		dialogue_supervisor:AddDialogue(dialogue);
	end

	dialogue = hoa_map.MapDialogue(5);
	text = hoa_system.Translate("Hello, Claudius.  Is your equipment in order?");
	dialogue:AddText(text, 6, -1, 4, false);
	dialogue_supervisor:AddDialogue(dialogue);

	if (GlobalManager:GetEventGroup("kyle_story"):DoesEventExist("betrayal") == true) then
		dialogue = hoa_map.MapDialogue(6);
		text = hoa_system.Translate("You'd be a fool to run out into the desert on your own for very long.  There's a cave to the west, though, and if you go far enough, you'll find water.");
		dialogue:AddText(text, 4, -1, 0, false);
		dialogue_supervisor:AddDialogue(dialogue);
	else
		dialogue = hoa_map.MapDialogue(6);
		text = hoa_system.Translate("I hear some guy stole from the kitchen yesterday.  They've tightened up security.");
		dialogue:AddText(text, 4, -1, 0, false);
		dialogue_supervisor:AddDialogue(dialogue);
	end

	dialogue = hoa_map.MapDialogue(7);
	text = hoa_system.Translate("Back home hey Claudius, we should get some rest.  Let's head back to the barracks.");
	dialogue:AddText(text, 2, 1, 0, false);
	text = hoa_system.Translate("Okay, let's call it a night.");
	dialogue:AddText(text, 1000, -1, 22113, false);
	dialogue_supervisor:AddDialogue(dialogue);
end

